import { launch } from 'puppeteer';
import { configure, render } from 'nunjucks';
import CleanCSS from 'clean-css';

const PAGE_HEADER = '<div></div>'
const PAGE_FOOTER = `
<div style="width: 100%; padding: 0 20mm; display: flex; font-size: 6pt;">
    <div style="margin-right: auto;">
        <p style="margin-bottom: 0;">Luisenplatz 10, 65185 Wiesbaden</p>
        <p style="margin-top: 0;">Telefon (0611)368-0 Telefax (0611)368-2099</p>
    </div>
    <div style="margin-left: auto">
        <div style="display: flex;">
            <div style="margin-right: 32px;">
                <p style="margin-bottom: 0;">E-Mail: poststelle.hkm@kultus.hessen.de</p>
                <p style="margin-top: 0;">Internet: www.kultusministerium.hessen.de</p>
            </div>
            <img height="28px" src="data:image/png;base64," />
        </div>
    </div>
</div>
`

export async function renderTemplate(template: string, data: object, styles: string[] = [], filters: { name: string, func: (...args: any[]) => any, async?: boolean | undefined }[] = []): Promise<Buffer> {
    const stylesheet = new CleanCSS().minify(styles).styles;

    const nunjucks = configure('', { autoescape: true });
    for (const filter of filters) {
        nunjucks.addFilter(filter.name, filter.func, filter.async);
    }

    const document = render(template, { style: stylesheet, data: data });

    const browser = await launch({
        headless: 'new', executablePath: process.env.CHROME_BIN,
        args: ['--no-sandbox', '--disable-gpu', '--disable-dev-shm-usage']
    });

    const page = await browser.newPage();
    await page.setContent(document);
    await page.waitForNetworkIdle();
    await page.emulateMediaType('print');

    const pdf = await page.pdf({
        preferCSSPageSize: true, printBackground: true,
        displayHeaderFooter: true, headerTemplate: PAGE_HEADER,
        footerTemplate: PAGE_FOOTER
    });

    await browser.close();
    return pdf;
}
